style.css:
@-moz-document domain("www.bing.com")
{
  #b_content {
    margin: 0 auto;
    width: fit-content;
    padding-left: 0
}

#b_header {
    max-width: 1360px;
    margin: 0 auto;
}

#b_dynRail,
.b_ad {
    display: none
}

.b_scopebar {
    margin-left: 0
}

#b_results>li.b_algo {
    margin-top: 8px;
    padding-top: 15px;
}

#b_results>li.b_algo {
    margin-bottom: 12px;
}

.b_algo.b_algo {
    box-shadow: 0 0 0 1.5px rgba(128, 128, 128, .3);
    border-radius: 6px;
}

#b_results {
    width: 800px
}

#b_results .b_algo .tpcn {
    border-bottom: 1.5px solid rgba(128, 128, 128, .3);
    margin: 0 -20px 10px -20px;
    padding: 0 20px 10px 20px;
}

#id_h {
    right: 0
}

.b_sydConvMode #b_content {
    position: relative;
}

#b_sydConvCont {
    display: flex;
    justify-content: center;
}

.cib-serp-main {
    max-width: 1184px;
}

#b_pole {
    margin: -25px 0 15px 0;
}

.b_dark #b_pole .ent-dtab-content>div:first-child,
.b_dark #b_topw .ent-dtab-content>div:first-child {
    padding-left: 12px
}

#sb_form {
    margin-left: -180px;
}
}
